import React from "react";


export default withOktaAuth(class GroupButton extends React.Component {

    state = {
        clicked: false
    }

    onClickHandler = () =>{
        this.setState({
            clicked: !this.state.renderEditForm
        })
    }

    checkStyle = () => {
        if (this.props.group.id in this.props.user.groups) {
            console.log("true")
        }
    }

    render() {
        return (
            <>
                {this.checkStyle()}
                <button onClick={this.onClickHandler} >{this.props.group.profile.name}</button>
            </>
        )
    }
})
